import React from "react";
import "./filter.css";

const Filter = props => {
  const { skills } = props;
  return (
    <div id="filter-container">
      <div className="row">
        <div id="skills-container" className="col-sm-12">
          {skills.map(s => {
            <span>{s.name}</span>;
          })}
        </div>
      </div>
    </div>
  );
};

export default Filter;
